cat_data = "data:image/gif;base64,"


getOutOfTwitterPleaseItsForYourOwnGood();

function getOutOfTwitterPleaseItsForYourOwnGood(){
    var randomNumber = Math.random();

    if(randomNumber < 0.1){
        left = Math.floor(Math.random()*window.innerWidth)
        tops = Math.floor(Math.random()*window.innerHeight)
        text = "<div style='position: fixed; width: 120px; height: 120px; left: "+left+"px; top: "+tops+"px;"+"'><img src='"+cat_data+"' style='width: 100%; height: 100%;'></div>"

        var fragment = document.createDocumentFragment()
        var div = document.createElement("div");
        div.innerHTML=text;
        while(div.firstChild)
            fragment.appendChild(div.firstChild)

        // document.getRootNode().body.innerHTML+= text;
        document.body.appendChild(fragment)
    }

    setTimeout(getOutOfTwitterPleaseItsForYourOwnGood,100);

}